;; <=

;; **
;;; Wow, we actually get six duplicate graphs. Indeed we need to be careful using unfiltered graph transformations, since the number of graphs produced may grow quickly. To avoid this, we can just use the filtered form of applying the `world` rule, which removes duplicates: 
;; **

;; @@
(-> (newgrape) 
  (->n* 3 hello)
  (->* world#)
  view)
;; @@
