;; **
;;; #### Until
;;; 
;;; As the name suggests, the _until_ loop (recursively) applys a set of operations until at least one of the derived graphs satisfied a given graph constraint. The _until_ macro uses the symbol `->*?` and has the general form `(->*? start test op1 op2 .. opm)`, where `start` is an input _grape_, `test` is a constraint that serves as the loop's break condition, and `op1 op2 .. opm` are operations on _grapes_.
;;; 
;;; As an example, consider the following constraint, which requires that any `Hello` node in the graph be connected to a `World` node by means of a `to` edge:
;; **

;; @@
(cond-constraint if-hello-then-to-world! []
                 (IF   (node h:Hello))
                 (THEN (node p:World)
                       (edge :to h p)))
;; @@
