;; **
;;; Let's compare the _until-distinct_ operator with the _until_ operator (the latter of which explores graphs even if they have been seen before in the exploration). Let's first count the number of graphs in the history graph of the above program:
;; **

;; @@
(-> _ history steps flatten count)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>17</span>","value":"17"}
;; <=

;; **
;;; There are 17 graphs. The program below uses the _until_ macro and produces a history graph with 216 graphs. (It also takes longer, please be patient.)
;; **

;; @@
(-> (newgrape) setup-ferryman
    (->*? all_on_the_other_side!
          (|| ferry_one_over cross_empty)
          (can-eat!- "Wolf" "Goat")
          (can-eat!- "Goat" "Grape")))
(-> _ history steps flatten count)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>216</span>","value":"216"}
;; <=

