;; **
;;; > Note: _GrapeVine_ checks whether all possible rule applications are parallel independent. If this is not the case, it will return an empty _grape_. (Negative Application Conditions are currently not considered in this check.)
;; **

;; **
;;; ## Importing / Exporting Graphs
;;; 
;;; _GrapeVine_ graphs are managed in the Neo4J graph database. However, they are represented as _graphs of graphs_ containing the entire derivation history and all versions. This begs the question of how we can _import_ regular Neo4J graphs for processing within _GrapeVine_ and how we can export specific versions to regular Neo4J graphs.
;; **

;; **
;;; ### Export
;;; 
;;;  _GrapeVine_ provides the `harvest` form for exporting graphs from its internal "multi-version" graph of graphs. The exported graph can then more easily processed with the regular Neo4J tools and functions. Let's use our example rules from part 1 of the tutorial again to demonstrate this:
;; **

;; @@
(list 
 (rule hello []
   (create 
     (node :Hello)))

(rule world []
   (read 
      (node h:Hello))
   (create 
      (node w:World)
      (edge :to h w )))

(rule vine []
   (read 
      (node h:Hello)
      (node w:World)
      (edge e:to h w ))
   (delete w e)
   (create 
      (node g:Grape {:calories "104"})
      (edge :to h g))))
;; @@
